INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 1, "あたしだって\nやるときはやるよ！", 0.0, 0, 1, 24001, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 1, 1, 24002, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 2, 1, 24003, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 2, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 3, 2, 24004, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 4, 1, 24005, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 5, 2, 24006, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 2, "あたしも意外と\nやるもんでしょ？", 0.0, 6, 2, 24007, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 7, 4, 24008, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 8, 4, 24009, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 4, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 9, 4, 24010, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 4, "やられた…\nねずみって意外と\nてごわいね", 0.0, 10, 4, 24011, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 11, 4, 24012, 0.0, 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 12, 4, 24013, 0.0, 1.81);
